const HeaderLinks = [
  {
    name: "The Details",
    href: "https://www.wealthsimple.com/en-ca/details",
    active: false,
    isButton: false
  },
  {
    name: "Magazine",
    href: "/en-ca/magazine",
    active: true,
    isButton: false
  },
  {
    name: "Sign in",
    href: "https://my.wealthsimple.com/app/login",
    active: false,
    isButton: false
  },
  {
    name: "Start investing",
    href: "https://my.wealthsimple.com/signup",
    active: false,
    isButton: true
  }
];

export default HeaderLinks;
